import React, { useState, useEffect } from 'react'
import Form from 'react-bootstrap/Form'
import Button from 'react-bootstrap/Button'
import { Container } from '../styled/layoutStyle'
import firebase from '../config'

function Calculate() {
    const [Start, setStart] = useState(0)
    const [End, setEnd] = useState()
    const firebaseRef = firebase.firestore().collection('History');
    const [data, setdata] = useState()
  
    function PushData() {

        const dataObj = {
            start:`${Start}`,
            end: `${End}`,
          };
        firebaseRef.doc().set(dataObj);
        console.log('success');

    }

    
    return (
        <Container>
            <h1>Prime number Calculate</h1>
            <Form onSubmit={PushData()}>
                <Form.Group>
                    <Form.Label>Start</Form.Label>
                    <Form.Control type="textfield" value={Start} onChange={e => setStart(e.target.value)}/>
                </Form.Group>
                <Form.Group>
                    <Form.Label>End</Form.Label>
                    <Form.Control type="textfield" value={End} onChange={e => setEnd(e.target.value)}/>
                </Form.Group>
                <Button variant="success" size="lg" block="block" type="submit">
                    Calculate
                </Button>
            </Form>
        </Container>
    )
}

export default Calculate
